import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./telaLogin/Loginogin"

function Rotas() {
    return (
        <>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<Login />} />
                </Routes>
            </BrowserRouter>
        </>
    )
}
export default Rotas;
